import { useState } from "react";
import {
  Navbar, 
  NavbarBrand, 
  Container,
  Collapse,
  NavbarToggler,
  Nav,
  NavItem,
} from "reactstrap";
import ProjectLogo from "../app/assets/img/logo.png";
import { NavLink } from "react-router-dom";


const Header = () => {
  return(
      <Navbar dark color="secondary" sticky="top" expand="md" className="navbar">
          <NavbarBrand href="/">
            <img src={ProjectLogo} alt="Logo" className="float-start" />
            <h1 className="mt-1">Martin Barrios</h1>
          </NavbarBrand>

          <Nav className="ms-auto" navbar>
              <NavItem>
                  <NavLink className="nav-link" to='/'></NavLink>
                    <i className='fa fa-home fa-lg' /> Home
              </NavItem>
              <NavItem>
                  <NavLink className="nav-link" to='/directory'></NavLink>
                    <i className='fa fa-list fa-lg' /> Directory
              </NavItem>
              <NavItem>
                  <NavLink className="nav-link" to='/about'></NavLink>
                  <i className='fa fa-info fa-lg' /> About
              </NavItem>
              <NavItem>
                  <NavLink className="nav-link" to='/contact'></NavLink>
                  <i className='fa fa-address-card fa-lg' /> Contact
              </NavItem>
          </Nav>
      </Navbar>
  );
};



